import os
from os.path import join, dirname
from dotenv import load_dotenv
from fbapy import *
import time

# Load .env file for APPSTATE if user leaves blank
dotenv_path = join(dirname(__file__), ".env")
load_dotenv(dotenv_path)

def main():
    print("=== Tool spam Messenger bằng fbapy + appstate ===")
    appstate = input("Nhập appstate (base64, để trống dùng APPSTATE trong .env): ").strip()
    if not appstate:
        appstate = os.environ.get("APPSTATE", "")
        if not appstate:
            print("❌ Không có appstate. Hãy nhập appstate hoặc tạo file .env với APPSTATE=...")
            return

    client = Client()
    try:
        api = client.login(
            appstate=appstate,
            options={
                "user_agent": "Mozilla/5.0 (Linux; Android 9; SM-G973U Build/PPR1.180610.011) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/69.0.3497.100 Mobile Safari/537.36"
            },
        )
    except Exception as e:
        print(f"❌ Đăng nhập thất bại: {e}")
        return

    thread_id = input("Nhập thread_id nhóm/chat (ID số): ").strip()
    if not thread_id.isdigit():
        print("❌ Thread ID phải là số!")
        return

    try:
        delay = int(input("Nhập delay (giây, mặc định 1): ").strip() or "1")
    except:
        delay = 1

    try:
        solan = int(input("Nhập số lần spam (0 = mãi mãi): ").strip() or "0")
    except:
        solan = 0

    message = input("Nhập nội dung muốn spam: ").strip()
    if not message:
        message = "hello from fbapy spam bot!"

    print(f"=== Bắt đầu spam vào {thread_id} (delay {delay}s, tổng {('vô hạn' if solan==0 else solan)} lần) ===")
    count = 0
    while solan == 0 or count < solan:
        try:
            api.http.send_message(message, thread_id)
            print(f"✅ Đã gửi {count+1} vào {thread_id}")
        except Exception as e:
            print(f"❌ Lỗi khi gửi: {e}")
        count += 1
        time.sleep(delay)

if __name__ == "__main__":
    main()
